SET @ctEG = "An electric guitar is a type of guitar designed to produce electronic sound. It utilizes electric pickups to convert the vibrations of the strings into electrical signals, which are then amplified and processed by an amplifier and external speakers to produce the final sound.\n\nThe design of an electric guitar typically resembles that of an acoustic guitar, with a front face (soundboard) and a back. However, the front face of an electric guitar usually does not have a soundhole since the sound is transmitted through the electric pickups rather than relying on the front face's vibrations. The body of an electric guitar is often made of woods such as maple or mahogany to achieve good sound quality.\n\nAn electric guitar can have one or multiple electric pickups, which are placed at various positions on the guitar body. These pickups are responsible for capturing the vibrations of the strings and converting them into corresponding electrical signals. There are two common types of pickups: single-coil pickups and humbucker pickups. Single-coil pickups produce a bright sound, while humbucker pickups have a more powerful sound and reduce noise.\n\nElectric guitars also feature sound controls such as volume and tone knobs, allowing the player to adjust the volume and tonal characteristics of the sound. Additionally, electric guitars typically have a pickup selector switch to choose between different pickups or combine them to create a variety of sounds.\n\nAn essential part of an electric guitar is its connection to an amplifier and external speakers. The electric signal from the guitar is fed into an amplifier, where it is amplified and processed to produce the final sound. The amplifier enables the player to adjust the volume, tone, and apply sound effects such as distortion, reverb, and delay to create a sound that suits their playing style and musical genre.\n\nElectric guitars are widely popular in genres such as rock, pop, blues, and jazz. They offer versatility and the ability to create powerful and diverse sounds, making them iconic instruments in modern music.";
SET @ctAG = "An acoustic guitar is a stringed instrument that produces sound acoustically, without the need for amplification or electrical components. It is designed to create sound through the vibration of its strings, which is then transferred to the soundboard and resonates within the hollow body of the guitar.\n\nThe acoustic guitar typically has a hollow wooden body with a soundhole in the center of the soundboard. The soundboard is made of a thin piece of wood, such as spruce or cedar, that vibrates when the strings are plucked or strummed. The vibrations of the strings are transmitted to the soundboard, which acts as a resonating surface, amplifying the sound and projecting it outward.\n\nThe neck of an acoustic guitar is usually made of wood and is attached to the body. It is topped with a fretboard, typically made of rosewood or ebony, which is divided into frets. The player presses down on the strings against the frets to change the pitch of the notes produced.\n\nAcoustic guitars can have either steel strings or nylon strings. Steel-string guitars are commonly used in genres such as folk, rock, country, and pop, while nylon-string guitars, also known as classical guitars, are popular in classical and flamenco music. The type of strings used affects the tone and playability of the guitar.\n\nAcoustic guitars often have tuning pegs at the headstock, which allow the player to adjust the tension of the strings and tune the instrument. They may also feature other elements such as a bridge, saddle, and nut, which contribute to the overall sound and playability of the guitar.\n\nOne of the appealing aspects of acoustic guitars is their portability and versatility. They can be played without the need for additional equipment or power sources, making them suitable for various settings, from intimate acoustic performances to outdoor gatherings. Acoustic guitars are widely used by both professional musicians and hobbyists due to their rich, warm sound and the ability to convey emotions through their organic and natural tones.\n\nOverall, acoustic guitars are cherished for their simplicity, expressive sound, and the ability to create beautiful music in a wide range of musical genres and styles.";
SET @ctP = "A piano is a large musical instrument that is played by pressing keys on a keyboard. It is a versatile instrument capable of producing a wide range of sounds and is often used in various genres of music, including classical, jazz, and contemporary.\n\nThe piano consists of a wooden frame with strings stretched across it. When a key is pressed, a mechanism inside the piano causes a hammer to strike the corresponding string or strings, producing sound. The length and thickness of the strings determine the pitch and tone of the notes produced.\n\nThe keyboard of a piano typically has 88 keys, with each key representing a different note. The keys are arranged in a repeating pattern of white and black keys. The white keys represent the natural notes (A, B, C, D, E, F, G), while the black keys represent the sharps and flats.\n\nPianos can be classified into two main types: grand pianos and upright pianos. Grand pianos have a horizontal, elongated shape, with the strings positioned horizontally inside the body. Upright pianos, also known as vertical pianos, have a more compact design, with the strings positioned vertically. Both types of pianos produce similar sounds, but grand pianos are generally considered to have a richer and more resonant sound due to their larger size.\n\nPianos are known for their wide dynamic range, meaning they can produce both soft and loud sounds. This is achieved by the player's touch on the keys. Pressing a key softly produces a softer sound, while pressing it with more force creates a louder sound.\n\nIn addition to the keys, pianos may have pedals that are operated by the pianist's feet. The most common pedal is the sustain pedal, which allows the strings to continue vibrating even after the keys are released, creating a sustained sound. There are also other pedals, such as the soft pedal (una corda) and the sostenuto pedal, which provide additional expressive capabilities.\n\nPianos are highly regarded for their versatility and expressive capabilities. They can be used as solo instruments, accompanying other musicians, or playing in ensembles and orchestras. The piano's ability to play melodies, harmonies, and chords simultaneously makes it a popular choice for composers and performers alike.\n\nOverall, the piano is a majestic instrument that has been captivating audiences for centuries. Its rich sound, wide range, and expressive qualities make it a cornerstone of music composition and performance.";
SET @ctD = "A drum is a percussion instrument that is widely used in various genres of music, such as rock, jazz, folk, and many others. It belongs to the family of membranophones, where sound is produced by striking the surface of the drum with hands or other striking tools, such as drumsticks or bare hands.\n\nThe drum has a drum shell, which is typically made of wood or metal, and is shaped in a circular or rectangular form. The drumhead, the surface of the drum, is usually made of animal skin, such as cowhide or goatskin, although synthetic options are also available. Most drums use one or two drumheads, each representing different tones and intensities.\n\nDrums come in various types and sizes, each with its own unique sound and role. For example, the bass drum is a large drum with a deep and powerful sound, often used to provide the fundamental rhythm and backbone of a musical piece. The snare drum and the tom-toms are medium-sized drums that produce distinctive tones and are used for fills, accents, and rhythmic patterns.\n\nThe drum set, also known as a drum kit, is a collection of drums and cymbals arranged in a specific configuration. It typically includes a bass drum, snare drum, tom-toms, hi-hat cymbals, crash cymbals, and ride cymbals. The drum set is commonly used in popular music genres and allows the drummer to create complex rhythms and patterns by combining different drum and cymbal sounds.\n\nDrums are played by striking the drumhead or drum shell with controlled force and technique. Drummers use various techniques and styles to produce different sounds, dynamics, and rhythms. They can create beats, fills, and solos, adding depth, texture, and energy to the music.\n\nDrums play a crucial role in establishing the rhythm and groove of a musical piece. They provide the foundation upon which other instruments and melodies are built. In addition to their rhythmic function, drums can also be melodic, with drummers incorporating tuned drums or using different drumhead tensions to produce specific pitches.\n\nOverall, drums are dynamic and versatile instruments that add power, rhythm, and excitement to music. Whether in a small acoustic setting or a large stage performance, drums play a vital role in driving the energy and creating a captivating musical experience.";
